import React from 'react';
import './App.css';
import Navbar from 'react-bootstrap/Navbar';

function App() {
  return (
    <div>
     <Navbar className="navbar">
        <Navbar.Brand className="navbar-brand" href="#home">SenseFlix</Navbar.Brand>
     </Navbar>
    </div>
  );
}

export default App;
